import React from 'react';

class Comment extends React.Component {
  constructor(props) {
    super(props);
    this.state = {name: '', message: ''};
  }
  render() {
  return (
    <React.Fragment>
      <b> {props.name} </b>
      <br></br> {props.message} <br></br>
    </React.Fragment>
);
}
}

export default Comment;
